window.initMap=function(){map=new google.maps.Map(document.getElementById("map"),{center:{lat:0,lng:0},zoom:3});for(var n=[{}],o=0;o<n.length;o++)e(n[o]);function e(n){const o=new google.maps.Marker({position:n.coords,map});if(n.iconImage&&o.setIcon(n.iconImage),n.content){const e=new google.maps.InfoWindow({content:n.content});o.addListener("click",(function(){e.open(map,o)}))}}};